import React from "react";
import "./Icon.scss";

export const Icon = ({ src, alt }) => {
  return (
    <div className="icon">
      <Image src={src} alt={alt} width={24} height={24} />
      <p>Arriba se encuentra una imagen</p>
    </div>
  );
};
